import NextLink from "next/link";
import { Flex, Text, Box, Link } from "@chakra-ui/core";

// const Navbar = () => {
//   return (
//     <body>
//       <nav>
//         <div>
//           <Link href="/">
//             <a id="navbar1">Jobaho</a>
//           </Link>
//         </div>
//         <div>
//           <Link href="/jobSection">
//             <a id="navbar2">Find a Job</a>
//           </Link>
//         </div>
//         <div>
//           <Link href="/testing">
//             <a id="navbar3">About Us</a>
//           </Link>
//         </div>
//         <div>
//           <Link href="/">
//             <a id="navbar4">Home</a>
//           </Link>
//         </div>
//       </nav>
//     </body>
//   );
// };

const NavbarLink = ({ children, ...props }) => (
  <Link px={5} {...props}>
    {children}
  </Link>
);

const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between" px={5} py={4}>
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <Link as={NextLink} to="/">
        Jobaho
      </Link>
    </Flex>
    <Box>
      <NextLink href="/" passHref>
        <NavbarLink>Home</NavbarLink>
      </NextLink>
      <NextLink href="/about" passHref>
        <NavbarLink>About us</NavbarLink>
      </NextLink>
      <NextLink href="/jobSection" passHref>
        <NavbarLink>Find a Job</NavbarLink>
      </NextLink>
    </Box>
  </Flex>
);

export default Navbar;
